Merging these files together can be done by executing the following code: fmerge merge -f=./root.json -p="{{ %f }}" The resulting file will be printed to STDOUT and will look like this: { "data": [ { "name": "Item 1", "data": { "foo": "bar"
}
}, { "name": "Item 2", "data": { "foo": "bar"
}
} ]
} The text replacement is done without respect to the formatting. The structure above is valid JSON, just formatted incorrectly. fmerge does not modify the content it merges in any way, shape or form. The correctly formatting JSON looks as follows: { "data": [ { "name": "Item 1", "data": { "foo": "bar" } }, { "name": "Item 2", "data": { "foo": "bar" } } ]
}
